                h2 > Settings < /h2> <
                ChangePassword / >
                <
                />
            )
        } <
        /div> <
        /div>
    );
};

export default class User extends Component {
    render() {
        return ( <
            div >
            <
            Account >
            <
            CUser / >
            <
            /Account> <
            /div>
        )
    };

};
